import React from 'react';
import Region from './Region';
import InfectedQuantity from './InfectedQuantity';

// Arrow Function
const InfectedLocation = () => (
  <div> 
    <ul>
      <li>
        <a href="">
          <Region></Region>: <InfectedQuantity></InfectedQuantity>
        </a>
      </li>
    </ul>
  </div>
);

export default InfectedLocation;


